-- Records of message
-- ----------------------------

-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_no` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '订单号',
  `type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '订单分类（1：服务订单；2邀约订单；3置换订单）',
  `source_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '订单类型（1：服务；2：邀约）',
  `source_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '服务/需求id（置换订单时为对方的服务id）',
  `my_source_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '我要交换的资源id',
  `date_time` int(10) NOT NULL DEFAULT '0' COMMENT '订单执行时间(格式化)',
  `time_long` float(10,2) unsigned DEFAULT '0.00' COMMENT '服务、邀约时长',
  `time_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '时间类型（0：不限时间；1：大概时间；2指定时间）',
  `price` float(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '服务单价（每小时服务费）',
  `province_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '省级id',
  `city_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '市级id',
  `area_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '区级id',
  `address` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '详细地址（不包括省市区）',
  `intro` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '订单介绍（即服务内容）',
  `total_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单总金额',
  `is_del` tinyint(4) unsigned NOT NULL DEFAULT '2' COMMENT '下单者是否删除（1：已删除；2未删除）',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '订单状态（1：待确认;2:已确认待付款；3：已付款；4：已完成；5已取消包括自己取消和对方拒绝）;6：对方是否删除订单;7:支付失败；',
  `options` text COLLATE utf8_bin COMMENT '订单附加信息（如：下单时的 服务 邀约详情）',
  `copy_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '服务/邀约快照信息',
  `copy_id2` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '置换订单中我的资源id',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '下单时间',
  `created_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '下单用户',
  `update_at` int(10) unsigned DEFAULT '0' COMMENT '修改时间',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `unique_order_no` (`order_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=149 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='服务邀约订单列表';

-- ----------------------------
-- Records of orders
-- ----------------------------

-- ----------------------------
-- Table structure for orders_account
-- ----------------------------
DROP TABLE IF EXISTS `orders_account`;
CREATE TABLE `orders_account` (
  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_no` varchar(50) NOT NULL COMMENT '订单编号',
  `type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '交易类型（1：充值；2：提现）',
  `pay_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '支付/提现方式（1：微信；2：支付宝）',
  `total_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `intro` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '2' COMMENT '充值状态（1：已支付；2：未支付;3:支付失败）',
  `uid` int(10) unsigned NOT NULL COMMENT '用户id',
  `created_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `unique_order_no` (`order_no`) USING BTREE COMMENT '保证订单号唯一'
) ENGINE=InnoDB AUTO_INCREMENT=357 DEFAULT CHARSET=utf8mb4 COMMENT='账户充值订单表';

-- ----------------------------
-- Records of orders_account
-- ----------------------------

-- ----------------------------
-- Table structure for reports
-- ----------------------------
DROP TABLE IF EXISTS `reports`;
CREATE TABLE `reports` (
  `reports_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `type` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '举报资源类型（1服务邀约；2:用户举报;3:举报圈子帖子和话题动态；）',
  `source_id` int(11) unsigned NOT NULL COMMENT '资源id',
  `configs_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '举报内容id',
  `created_uid` int(11) unsigned NOT NULL COMMENT '添加者',
  `created_at` int(11) unsigned DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`reports_id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COMMENT='举报数据列表';

-- ----------------------------
-- Records of reports
-- ----------------------------

-- ----------------------------
-- Table structure for running
-- ----------------------------
DROP TABLE IF EXISTS `running`;
CREATE TABLE `running` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `money` decimal(10,3) unsigned NOT NULL DEFAULT '0.000' COMMENT '流水金额',
  `pay_type` tinyint(4) unsigned NOT NULL COMMENT '支付方式（1：微信；2：支付宝；3：钱包）',
  `type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '流水分类（1：充值+；2：消费-；3：退款+；4：提现-；5：收入+;6：冻结-；7：解冻+；8：退款+；9：冻结金额扣除-；11：支付失败扣除-；12:补偿+）',
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '流水所属用户id',
  `options` varchar(255) DEFAULT NULL COMMENT '附加信息',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '流水产生时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8mb4 COMMENT='流水明细表';

-- ----------------------------
-- Records of running
-- ----------------------------

-- ----------------------------
-- Table structure for running_callback
-- ----------------------------
DROP TABLE IF EXISTS `running_callback`;
CREATE TABLE `running_callback` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `trade_no` varchar(64) NOT NULL COMMENT '支付宝交易凭证号',
  `out_trade_no` varchar(64) NOT NULL COMMENT '原支付请求的商户订单号',
  `out_biz_no` varchar(64) NOT NULL COMMENT '商户业务ID，主要是退款通知中返回退款申请的流水号',
  `buyer_id` varchar(16) NOT NULL COMMENT '买家支付宝用户号',
  `buyer_logon_id` varchar(100) NOT NULL COMMENT '买家支付宝账号',
  `seller_id` varchar(16) NOT NULL COMMENT '卖家支付宝用户号',
  `seller_email` varchar(100) NOT NULL COMMENT '卖家支付宝账号',
  `trade_status` varchar(32) NOT NULL COMMENT '交易状态',
  `total_amount` decimal(9,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `receipt_amount` decimal(9,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实收金额',
  `invoice_amount` decimal(9,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '用户在交易中支付的可开发票的金额',
  `options` text COMMENT '异步通知所有参数',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='支付回调记录';

-- ----------------------------
-- Records of running_callback
-- ----------------------------

