-- ----------------------------
-- Table structure for services
-- ----------------------------
DROP TABLE IF EXISTS `services`;
CREATE TABLE `services` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(10) unsigned NOT NULL COMMENT '分类',
  `time_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '时间方式（0：不限时间；1：指定时间；2：平时周末；其他数据表示服务的时间分类）',
  `date_time` int(10) unsigned NOT NULL DEFAULT '0',
  `time_long` float(10,1) unsigned NOT NULL DEFAULT '0.0' COMMENT '邀约时长',
  `type` tinyint(4) unsigned NOT NULL COMMENT '主题分类（1：服务；2:邀约）',
  `title` varchar(255) NOT NULL COMMENT '标题（主题）',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '服务价格',
  `price_unit` tinyint(10) unsigned NOT NULL DEFAULT '1' COMMENT '价格单位（1:每小时;2:每天;3：每场）',
  `intro` text NOT NULL COMMENT '详细介绍',
  `province_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '省级id',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '市级id',
  `area_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '区级id',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '详细地址',
  `gender` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '邀约对象（1：男；2：女；0:不限）',
  `pay_way` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式(1：AA;2:我买单;3:你买单）',
  `sounds` varchar(255) NOT NULL DEFAULT '' COMMENT '音频文件存储',
  `sounds_length` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '音频文件总时长',
  `attaches` text NOT NULL COMMENT '附件列表信息',
  `skills` varchar(255) DEFAULT NULL COMMENT '置换技能',
  `is_online` tinyint(4) unsigned NOT NULL DEFAULT '2' COMMENT '1:线上；2线下',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '2' COMMENT '服务状态(1:审核通过；2：待审核；3：已关闭；4:审核拒绝)',
  `is_del` tinyint(4) unsigned DEFAULT '0' COMMENT '服务状态（0：未删除；1：已删除）',
  `created_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建者id',
  `created_at` int(10) unsigned DEFAULT NULL COMMENT '创建时间',
  `update_at` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='服务列表';

