-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `uid` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_uniq` varchar(255) NOT NULL COMMENT '唯一标识(用户密码的加密)',
  `login_name` varchar(255) NOT NULL COMMENT '登录用户名',
  `nick_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '用户昵称',
  `wx_identify` varchar(512) DEFAULT '' COMMENT '微信联合登录标识',
  `qq_identify` varchar(100) DEFAULT NULL COMMENT 'QQ联合登录标识（openid）',
  `wb_identify` varchar(100) DEFAULT NULL COMMENT '微博联合登录标识',
  `login_pass` varchar(255) NOT NULL COMMENT '密码(加密后的密码)',
  `last_login_ip` varchar(255) DEFAULT NULL COMMENT '最近一次登录IP',
  `last_login_time` int(10) DEFAULT NULL COMMENT '最近一次登录时间',
  `token` varchar(40) DEFAULT NULL COMMENT 'token',
  `ry_token` varchar(255) DEFAULT NULL COMMENT '融云账户对应的用户token',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '是否为正常用户（1:正常;2:禁用）',
  `created_at` int(10) NOT NULL COMMENT '注册时间',
  `update_at` int(10) DEFAULT NULL COMMENT '更新时间',
  `is_admin` tinyint(4) unsigned NOT NULL DEFAULT '2' COMMENT '1管理员；2：app用户',
  `license` text COMMENT '用户权限',
  `group` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '用户角色',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=100099 DEFAULT CHARSET=utf8 COMMENT='登录用户列表';

-- ----------------------------
-- Records of users
-- ----------------------------

