-- ----------------------------
-- Records of users_data
-- ----------------------------

-- ----------------------------
-- Table structure for users_ext
-- ----------------------------
DROP TABLE IF EXISTS `users_ext`;
CREATE TABLE `users_ext` (
  `uid` int(10) unsigned NOT NULL COMMENT '用户id',
  `account` decimal(10,3) unsigned DEFAULT '0.000' COMMENT '账户金额',
  `freeze_money` decimal(10,3) unsigned DEFAULT '0.000' COMMENT '冻结金额',
  `sex` tinyint(4) unsigned DEFAULT '0' COMMENT '性别（0保密、1男、2女）',
  `birthday` varchar(20) DEFAULT '' COMMENT '出生日期(格式2017-06-02)',
  `tags` varchar(255) DEFAULT '' COMMENT '标签',
  `intro` text COMMENT '个性签名',
  `latitude` float(10,6) unsigned DEFAULT NULL COMMENT '经度',
  `longitude` float(10,6) unsigned DEFAULT NULL COMMENT '纬度',
  `attach_id` int(10) unsigned DEFAULT NULL COMMENT '头像附件id',
  `avatar` varchar(255) DEFAULT '' COMMENT '头像',
  `update_at` int(10) unsigned DEFAULT NULL COMMENT '修改时间（冗余）',
  `occupation` int(10) unsigned DEFAULT '0' COMMENT '职业',
  `height` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '身高',
  `weight` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '体重',
  `marry` tinyint(4) unsigned DEFAULT '0' COMMENT '情感状态（1：单身；2：已婚；3：离异）',
  `hot_address` varchar(255) DEFAULT NULL COMMENT '常出没地址',
  `school_id` int(10) unsigned DEFAULT '0' COMMENT '学校id',
  PRIMARY KEY (`uid`),
  KEY `normal_latitude` (`latitude`) USING HASH,
  KEY `normal_longitude` (`longitude`) USING HASH
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='登录用户信息扩展表';

-- ----------------------------
-- Records of users_ext
-- ----------------------------
